import React from 'react'

const randompics = 
  [{image:'https://www.weddingwire.in/assets/img/directory/headings/bg_directory-hero-banquetes.jpg',img_name:'food'},
  {image:"https://www.weddingwire.in/assets/img/directory/headings/bg_directory-hero-wedding-photography.jpg",img_name:'jewellery'},
  {image:"https://www.weddingwire.in/assets/img/directory/headings/bg_directory-hero-wedding-planners.jpg",img_name:'event'},
  {image:"https://www.weddingwire.in/assets/img/directory/headings/bg_directory-hero-bridal-makeup.jpg",img_name:'greengrocry'},
 {image:"https://www.weddingwire.in/assets/img/directory/headings/bg_directory-hero-wedding-decoration.jpg",img_name:'music'},
  {image:'https://www.weddingwire.in/assets/img/directory/headings/bg_directory-hero-catering.jpg',img_name:'wedding'}]

function InnerPageBanner() {
  return (
    <div>
    {
    randompics.map((itmes,index)=>{ 
       <img src={itmes.image} alt='harika'></img>

    })}
    </div>
  )
}

export default InnerPageBanner
